import { styled } from 'baseui';

const LinkText = styled('a', ({ $theme }) => ({
  color: $theme.colors.contentAccent,
  textDecoration: 'none',
  cursor: 'pointer',
  ...$theme.typography.font200,

  ':hover': {
    textDecoration: 'underline',
  },
}));

export default LinkText;
